pragma solidity 0.5.0;

import "@openzeppelin/contracts/ownership/Ownable.sol";
import "@openzeppelin/contracts/math/SafeMath.sol";


/**
 * Name    : Rage Contest smart contract for managing a contest  
 * Company : Rage.Fan 
 * Author  : Saravana Malaichami (saravana at rage.fan)
 * Date    : 20-Feb-2021
 * Version : 0.1 
 */

contract TokenInterface {
    function transfer(address _to, uint256 _value) public returns (bool success);
    function transferFrom(address _from, address _to, uint256 _value) public returns (bool);
    function balanceOf(address who) public view returns (uint256);
    function allowance(address owner, address spender)  public view returns (uint256);
    function approve(address _spender, uint256 _value) external returns (bool success);
}


/**
 * @title Fantasy Contest
 * @dev 
 * @dev 
 */

contract RageContest is Ownable {

    string public  contestId;
    string public  name;
    Player[] public players;

    uint public entryFree;
    uint public prizePool;
    uint public decimals;
    uint public maxContestants;
    uint public minContestants;
    uint public startTime;
    uint public endTime;
    bool public canceled;   
    address  public player; 
    address[] public contestants; 


    struct Player {
      string id; 
      string name;
      string points;
      string captain;  //C,VC,P  
    }

    event ContestCanceled();

    /*
    * Contract Constructor
    */
    constructor(string memory _name, string memory _id, uint _startTime, uint _endTime) public {
        name      = _name;
        contestId = _id;
        startTime = _startTime;
        endTime   = _endTime;

    }

    function withdraw()
        public pure
        // onlyEndedOrCanceled
       returns (bool success)
        {
            return true;
        }

    // function getContestants ()
    //     view
    //     public
    //     returns(memory address[])
    //     {
    //         return contestants;
    //     }

function cancelContest()
        public
        onlyOwner
        onlyBeforeEnd
        onlyNotCanceled
        returns (bool success)
    {
        canceled = true;

        emit ContestCanceled();
        return true;
    }


//     modifier onlyNotOwner {
//         require (msg.sender != owner) ;
//         _;
//     }

    modifier onlyAfterStart {
        require (block.timestamp > startTime) ;
        _;
    }

    modifier onlyBeforeEnd {
        require (block.timestamp < endTime) ;
        _;
    }

    modifier onlyNotCanceled {
        require (!canceled) ;
        _;
    }

    modifier onlyEndedOrCanceled {
        require (block.timestamp > endTime || canceled) ;
        _;
    }
}
